import React, { useState } from 'react';


const App = () => {

    const [num,setNum]=useState(5);

    const incNum=()=>{
        setNum(10);
    }
    


    return(
        <>
           <div className="main_div">
           <div className="child_div">
                <h1>{num}</h1>
                <div className="div_btn">
                <button onClick={incNum}>Increm</button>
                <button>Decrem</button>
                </div>
                </div>
           </div>
        </>
    );
                    
};

export  default App;
